import React from 'react';

export default function IndexPage({user, onNavigate}){
  return (
    <div>
      <h2>Welcome to Splunk lite</h2>
      {!user && <p>Please sign in or sign up to continue.</p>}
      {user && (
        <div>
          <p>Welcome, {user.username} â€” choose where to go:</p>
          <div style={{display:'flex',gap:8}}>
            <button onClick={()=>onNavigate('logs')}>Logs</button>
            <button onClick={()=>onNavigate('search')}>Search</button>
            <button onClick={()=>onNavigate('alerts')}>Alerts</button>
          </div>
        </div>
      )}
    </div>
  );
}
